// файл для переменных со всего проекта

export const myTheme = {
	colors: {
		primar: "gold",
		secondary: "pink",
		grey: {
			dark: "#393737",
			light: "#98979b"
		}
	},

	media: {
		tablet: "screen and (max-width:768px)",
		mobile: "screen and (max-width: 576px)"
	}
}
